import React, { useState } from "react";
import s from "./HeaderInput.module.css";
import arrow from "./arrow.png"
const HeaderInput = (props) => {
  const [selectorFrom, setSelectorFrom] = useState("");
  const [selectorTo, setSelectorTo] = useState("");

  const [money, setMoney] = useState("");
  let incomeOptions = props.data.map((item) =>
    item.title == "Income" ? <option value={item.name}>{item.name}</option> : ""
  );
  function rerend() {
    props.rerenderTree();
  }

  function transfer() {
    if (
      money != "" &&
      selectorFrom != "" &&
      selectorTo != "" &&
      money !== null &&
      selectorFrom !== null &&
      selectorTo !== null
    ) {
      for (let i = 0; i < props.data.length; i++) {
        if (selectorFrom == props.data[i].name) {
          props.data[i].count = props.data[i].count + parseFloat(money);
        }
        if (selectorTo == props.data[i].name) {
          props.data[i].count = props.data[i].count + parseFloat(money);
        }
      }
      console.log(props.data);

      props.history.push({
        id: props.history.length + 1,
        from_title: selectorFrom,
        to_title: selectorTo,
        status: true,
        money: money,
      });
      setMoney("");
      props.rerenderTree();
    }
  }

  function transferFromAccount() {
    if (
      money != "" &&
      selectorFrom != "" &&
      selectorTo != "" &&
      money !== null &&
      selectorFrom !== null &&
      selectorTo !== null
    ) {
      for (let i = 0; i < props.data.length; i++) {
        if (selectorFrom == props.data[i].name) {
          props.data[i].count = props.data[i].count + parseFloat(money);
        }
        if (selectorTo == props.data[i].name) {
          props.data[i].count = props.data[i].count + parseFloat(money);
        }
      }

      props.history.push({
        id: props.history.length + 1,
        from_title: selectorFrom,
        to_title: selectorTo,
        status: true,
        money: parseFloat("-" + money),
      });

      setMoney("");
      props.rerenderTree();
    }
  }

  const handleKeyUp = (e) => {
    if (e.key == "Enter") transfer();
  };

  return (
    <div className={s.HeaderInput}>
      <div className={s.header_text}>Coinkeeper</div>
      <div className={s.formInput}>
        <div className={s.first}>
          <h4 className={s.inp_tt} >
            <p style="margin-left:10px"
            >Доход</p>
            <img src={arrow} height={30}/>
            <p>Cчет</p></h4>
          <div className={s.formBlock}>
            <div className={s.formtext}>Из</div>

            <select
              className={s.inp_select}
              name=""
              id=""
              onClick={rerend}
              onChange={(e) => {
                setSelectorFrom(e.target.value);
              }}
            >
              <option className={s.inp_opt} value="asd"  selected>
                Выбрать
              </option>
              {incomeOptions}
            </select>
            <div className={s.formtext}>В</div>
            <select
              className={s.inp_select}
              name=""
              id=""
              onClick={rerend}
              onChange={(e) => {
                setSelectorTo(e.target.value);
              }}
            >
              <option className={s.inp_opt} value="asd" selected>
                Выбрать
              </option>
              {props.data.map((item) =>
                item.title == "Account" ? (
                  <option className={s.inp_opt} value={item.name}>
                    {item.name}
                  </option>
                ) : (
                  ""
                )
              )}
            </select>
            <input
            className={s.inpnumber}
              placeholder="Сумма"
              type="number"
              onChange={(e) => setMoney(e.target.value)}
              onKeyUp={(e) => handleKeyUp(e)}
            />
            <button className={s.btn} onClick={transfer}>
              DO IT
            </button>
          </div>
        </div>
        <div className={s.second}>
          <h4 className={s.inp_tt}>
            <p>C</p>
            <img src={arrow} height={30}/>
            <p>Cчет</p></h4>
          <div className={s.formBlock}>
            <div className={s.formtext}>Из</div>
            <select
              className={s.inp_select}
              onClick={rerend}
              onChange={(e) => {
                setSelectorFrom(e.target.value);
              }}
            >
              <option className={s.inp_opt} value="asd"  selected>
                Выбрать
              </option>
              {props.data.map((item) =>
                item.title == "Account" ? (
                  <option className={s.inp_opt} value={item.name}>
                    {item.name}
                  </option>
                ) : (
                  ""
                )
              )}
            </select>
            <div className={s.formtext}>В</div>
            <select
              className={s.inp_select}
              onClick={rerend}
              onChange={(e) => {
                setSelectorTo(e.target.value);
              }}
            >
              <option className={s.inp_opt} value="asd"  selected>
                Выбрать
              </option>
              {props.data.map((item) =>
                item.title == "Expenses" ? (
                  <option className={s.inp_opt} value={item.name}>
                    {item.name}
                  </option>
                ) : (
                  ""
                )
              )}
            </select>
            <input
              className={s.inpnumber}
              placeholder="Сумма"
              type="number"
              onChange={(e) => setMoney(e.target.value)}
              onKeyUp={(e) => handleKeyUp(e)}
            />
            <button className={s.btn} onClick={transferFromAccount}>
              DO IT
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};
export default HeaderInput;
